import React from "react";
import { Link } from "react-router-dom";
import godzillaList from "../../lists/godzillaList";
import { Route } from "react-router-dom";
import GodzillaPath from "./godzillaPathname";

const GodzillaListDisplay = () => {
  const godzillaListMap = godzillaList.map((godzilla) => {
    return (
      <li>
        <Link to={"/godzilla-list" + godzilla.link}>{godzilla.name}</Link>
      </li>
    );
  });

  return (
    <>
      <h2>Godzilla</h2>
      <ul>{godzillaListMap}</ul>
    </>
  );
};

const GodzillaRouter = () => {
  for (let i = 0; i < godzillaList.length; i++) {
    return (
      <Route
        path={"/godzilla-list" + godzillaList[i].link}
        component={GodzillaPath}
      />
    );
  }
};

export { GodzillaListDisplay, GodzillaRouter };
